webpackJsonp([0xd8d359734e91],{552:function(e,o){e.exports={pathContext:{docHtml:'<h1>Site</h1>\n<h2>Developing And Testing</h2>\n<p>The web site is build using <code>mkdocs</code> and <code>mkdocs-material</code>. </p>\n<p>To test:</p>\n<pre><code class="language-bash">mkdocs serve\n</code></pre>\n<p>Check for broken external links:</p>\n<pre><code class="language-bash">find docs -name \'*.md\' -exec grep -l http {} + | xargs awesome_bot -t 3 --allow-dupe --allow-redirect -w argocd.example.com:443,argocd.example.com,kubernetes.default.svc:443,kubernetes.default.svc,mycluster.com,https://github.com/argoproj/my-private-repository,192.168.0.20,storage.googleapis.com,localhost:8080,localhost:6443,your-kubernetes-cluster-addr,10.97.164.88 --skip-save-results --\n</code></pre>\n<h2>Deploying</h2>\n<pre><code class="language-bash">mkdocs gh-deploy\n</code></pre>\n<h2>Analytics</h2>\n<p>!!! tip\nDon\'t forget to disable your ad-blocker when testing.</p>\n<p>We collect <a href="https://analytics.google.com/analytics/web/#/report-home/a105170809w198079555p192782995">Google Analytics</a>.</p>',docPath:"argo-cd/docs/developer-guide/site",proj:"argo-cd"}}}});
